import { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom';
import { Coupon } from '../../Entitis.type';
import '../../Design/CompanyGetAllCoupons.css'

interface Props {
  token: string | undefined
  id: number | undefined
}
const CompanyGetAllCoupons = (props: Props) => {
  const url = 'http://localhost:8080/company/getCoupons?companyId=' + props.id;

  const [coupons, setCoupons] = useState<Array<Coupon>>([]);
  const navigate = useNavigate();
  console.log(props.token);

  useEffect(() => {
    fetch(
      url,
      {
        method: 'GET',
        headers: {
          Authorization: props.token!,
          'Content-Type': 'application/json',
        },
        mode: 'cors',
      }
    ).then((res) => res.json()).then((data) => {
      setCoupons(data);
      console.log(data); // log response data to console
    }).catch((error) => console.log(error))
  }, [])

  
    return (
      <div className='getAllCompanys'>
        <button className='goBack' onClick={() => navigate(-1)}>Back</button>
        {coupons.map((coupon) => {
          return (
            <div key={coupon.id} className='coupons'>
              <table>
                <tbody>
                  <tr className='couponKey'>
                    <td>ID</td>
                    <td>Category</td>
                    <td>Price</td>
                    <td>Amount</td>
                    <td>End Date</td>
                    <td>Image</td>
                  </tr>
                  <tr>
                    <td className='couponId'>{coupon.id}</td>
                    <td className='couponCategory'>{coupon.category}</td>
                    <td className='couponPrice'>{coupon.price}</td>
                    <td className='couponAmount'>{coupon.amount}</td>
                    <td className='coupon'>{coupon.endDate}</td>
                    <td className='couponImage'><img src={coupon.image} alt='Coupon' /></td>
                  </tr>
                </tbody>
              </table>
            </div>
          )
        }
  
        )}
      </div>
    )
  }
  export default CompanyGetAllCoupons;
